NewsFeed\httpsfeedqgisorg\27\content = "<p>Dear QGIS community, we recently completed the 2020 PSC <strong>election</strong> process whereby the community votes for their favourite community members to help steer the future of QGIS. I am really honoured and excited to have been entrusted with the task of representing our fantastic community and I am really happy to have such an amazing PSC helping me in taking QGIS to even greater heights. To find out more about the <strong>outcome</strong> of the QGIS PSC elections, the AGM and my vision, <strong>double-click</strong> this message to open it in your browser.<span id=\"docs-internal-guid-cb126a5f-7fff-3d55-2517-e7c137c58311\" style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\"></span></p>"
NewsFeed\httpsfeedqgisorg\29\content = "<p>Do you want to see all the fantastic <strong>new features</strong> and <strong>bug fixes</strong> that were introduced in QGIS 3.14? <strong>Double-click</strong> this message to open the visual changelog in your browser. Our <strong>visual changelogs</strong> provide a nice, centralized list of all the key new features in each release. Each feature description is usually accompanied by an image or short screen recording. We extend our grateful acknowledgment to our many sustaining members, donors, volunteers and developers who made this release a reality.</p>"
NewsFeed\httpsfeedqgisorg\31\content = "<p>Have you been missing all the buzz and excitement around the 6-monthly in-person meetups we used to hold? Perhaps you live far away from Europe and could never join these meetups in person? Well we have great news for you! Starting August Friday 28th 2020, we will be holding day-long <strong>virtual</strong> meetups on the last friday of each month. Come and chat to the developers and maintainers of QGIS and it's related infrastructure. Talk to other users to share tips and tricks. Collaborate with other like-minded users to work on inititives for yourselves and your community. Attendance is free and all are welcome regardless of your experience or past involvment in the project. <strong>Double-click on this news feed entry to find out more!</strong></p>"
NewsFeed\httpsfeedqgisorg\32\content = "<p></p>\r\n<p>QGIS will drop 32-bit support on Windows after the QGIS 3.16 release when we update our Qt dependencies to Qt 5.15. The update to Qt 5.15 is an important step towards staying in sync with Qt developments. Qt 5.15 is the minimum version that will provide forward compatibility with Qt 6. By updating to 5.15, we, therefore, ensure that QGIS is future proof. <strong>Please double-click this entry to find out more.</strong></p>"
NewsFeed\httpsfeedqgisorg\48\content = "<p>We are extremely proud to present QGIS 3.24 to you, our loyal users. This release is jam-packed with great new features, bug fixes and cartography tools. We named this release 'Tisler' after a small Norwegian island that was a favourite visiting place of H&aring;vard Tveite, who passed away in May 2021. H&aring;vard was a very active member of the QGIS community, providing valuable input to the documentation, developing numerous plugins, and taking care of the QGIS Resources Sharing Repository to name just a few of his contributions. The map on the QGIS 3.24 splash screen is an orienteering map that H&aring;vard has created. He liked spending some time each year map-making at Tisler. To find out more about the wonderful features included in QGIS 3.24, please <strong>double click this entry</strong>.</p>"
NewsFeed\httpsfeedqgisorg\49\content = "<p>A message of peace from the QGIS Community: We, the developers, contributors and community members of the QGIS Project view the ongoing world events in Ukraine and other conflict areas around the world with great sadness. Our aim in developing QGIS has always been to provide a powerful tool to support the creation of a just and humane society. We want to enable a world where every person has a voice, the ability to express, and be secure in, their tenure in their homes, villages, towns, cities and countries.&nbsp;We hope tools like QGIS are used to the benefit of all citizens on earth, to support a sustainable environment, an orderly society and, in particular, to establish and preserve sovereign dignity, security and freedom from oppression.</p>\r\n<p>We ask the leaders of the world to resolve their disputes peacefully, through negotiation and compromise, humility and deference to the citizens who are placed in your care. To the members of the QGIS Community that are caught up in this conflict, our thoughts and support are with you, and we hope that you and your families are safe and that this conflict comes to a speedy end.</p>"
